    public function actionInit()
    {
        //*************************************************
        //
        //  Заполнение таблицы Location
        //
        //*************************************************
        
        
        Location::deleteAll();
        //добавляю данные
        foreach ($this->LocationData as $key => $value) {
            $model=new Location();
            $model->id=$value['id'];
        
            $model->parent_id=$value['parent_id'];
            $model->name=$value['name'];
            $model->type=$value['type'];
            if($model->save()){
                echo 'Added '.$value['name'].PHP_EOL;
            }else{
                echo 'Error on ID('.$model->id.'): '.json_encode($model->errors).PHP_EOL;
            }
        }
        
        

        
        //*************************************************
        //
        //  Заполнение таблицы Proxy
        //
        //*************************************************
        Proxy::deleteAll();
        $cityName='';
        $location=null;
        foreach ($this->ProxyData as $key => $value) {
            if($cityName!=$value['name']){
                $location=Location::findOne(['name'=>$value['name']]);
            }

            if(isset($location)){
                $proxy=new Proxy();
                $proxy->status=Proxy::STATUS_ENABLED;
                $proxy->type=Proxy::TYPE_PAID;
                $proxy->protocol=Proxy::PRORTOCOL_HTTP_HTTPS;
                $proxy->ip=$value['ip'];
                $proxy->location_id=$location->id;
                $proxy->port=$value['port'];

                $proxy->paid_to=strtotime('28.03.2018');

                $proxy->username=$value['username'];
                $proxy->password=$value['password'];

                if(!$proxy->save()){
                    $this->stdout('Онибка сохранения: '.json_encode($proxy->errors,JSON_UNESCAPED_UNICODE).PHP_EOL);    
                }

            }else{
                $this->stdout('Не нашел город: '.$value['name'].PHP_EOL);
            }
        }


        /*

      
        //Привожу в соответствие к данным базы GoIP
